import React, { useState } from 'react';
import '../App.css';
import { InputWithButton } from './Input';


  function App() {
    let initial ={
      '单词': 'Hello',
      '解释': '你好',
      '词族': ['greeting','salutation']
      }

  const [vocabList,setVocabList] = useState([initial]);
  const [inputid,setinputId] = useState(0);


    function handler(){
      console.log('Button clicked');
  }
  return (
    <>
    <InputWithButton id={inputid}  type="text"  onChange={(e) => console.log(e.target.value)} onClick={handler} />

    <div> {
      vocabList.map((key, index) => {
        return <ul key={index}>
          {Object.entries(key).map(([key, value], index) => <li key={index}>{`${key}: ${value}`}</li>)}
        </ul>
      })
    } 
    </div>
  </>

  );
}

export default App;
